    def __init__(self, parent):
        self.cc = parent.cc
        print ("[|] loading PatternManager")

    def padStringToDwords(self, stringToPad):
        dwordPadder = lambda item: item + "\x00" * 3
        return "".join(map(dwordPadder, stringToPad))

    def getTokenizedSignatures(self, pattern_length):
        """
        Get the full collection of signature, but with each signature tokenized in byte-strings of
        maximum length pattern_length. The storage format is almost the same as the signature storage,
        a dictionary of key/value ("byte_signature", ["signature_name"])
        @param: pattern_length: maximum length of patterns to return
        @type pattern_length: int
        """
        tokens_to_names = {}
        for signature in self._getStaticPatternKeys():
            tokenized = [(signature[index:index + pattern_length], self.signatures[signature]) for index \
                in xrange(0, len(signature), pattern_length)]
            for token in tokenized:
                if not self._isZeroToken(token[0]):
                    if token[0] in tokens_to_names.keys():
                        tokens_to_names[token[0]].append(token[1])
                    else:
                        tokens_to_names[token[0]] = [token[1]]
        return tokens_to_names

    def _isZeroToken(self, token):
        """
        Check if the given token consists only of zero bytes
        @param token: a token to check for zero bytes
        @type token: str
        """
        for c in token:
            if c != "\x00":
                return False
        return True

    def _getStaticPatternKeys(self):
        """
        Return all static patterns. Convenience function to differentiate them from the variable patterns.
        @return (list) of keys from PatternManager.signatures of static keys
        """
        static_signature_keys = []
        for signature in self.signatures.keys():
            if not isinstance(signature, self.cc.VariablePattern):
                static_signature_keys.append(signature)
            # extend self.signatures by dword padded version of MutablePatterns
            if isinstance(signature, self.cc.MutablePattern):
                padded = self.padStringToDwords(signature)
                self.signatures[padded] = self.signatures[signature] + " (dword padded)"
                static_signature_keys.append(padded)
        return static_signature_keys

    def getVariableSignatures(self):
        """
        Return the set of variable signatures.
        @return: (dict) of variable signatures as keys with signature names as values
        """
        variable_signatures_to_names = {}
        for signature in self.signatures.keys():
            if isinstance(signature, self.cc.VariablePattern):
                variable_signatures_to_names[self.signatures[signature]] = signature
        return variable_signatures_to_names

    def printSignatures(self):
        """
        Used for informational purposes only, prints all names of signatures defined in the PatternManager
        """
        print ("[+] PatternManager has the following signatures: ")
        occurrences = self.get_signature_occurrences()
        for signature in sorted(occurrences.keys()):
            print ("     %s: %d") % (signature, occurrences[signature])

